import React from "react";
import { Card, Button,Col } from 'react-bootstrap';
import "../App.css";

function Project(props) {
  return (

<Card >
  <Card.Img variant="top" src={props.imgUrl} className="project-img"/>
  <Card.Body>
    <Card.Title>{props.title}</Card.Title>
    <Card.Text>
      {props.description}
    </Card.Text>
    <Button variant="primary" href={props.repo} target="blank">Github Repo</Button>
    <Button variant="primary" href={props.live} target="blank">Deployed App</Button>
  </Card.Body>
</Card>

  );
}

export default Project;
